import "../styles/promotions.css";

const GymBenefits = () => {
  return (
    <section className="gym-benefits">
      <div className="benefit-disc">Nueva línea Oversize</div>
      <div className="benefit-disc">Envío gratis por compras superiores a $150.000</div>
      <div className="benefit-disc">10% OFF en colección Noir</div>
    </section>
  );
};

export default GymBenefits;
